def cum_ae(pred,y_test):
  aggr_cae_collector = []
  for i in range (pred.shape[0]):
    if i:
      current_ae = np.abs(pred[0:i]-y_test[0:i])
      cae = np.sum(current_ae)
      aggr_cae_collector.append(cae)
    else:
      cae = pred[0]
      aggr_cae_collector.append(cae)
  return np.asarray(aggr_cae_collector)

